import React from 'react';
import ReactDOM from 'react-dom';
import './Heading';
import Heading from './Heading';
import Para from './Para';
import OrderData from './OrderData';


ReactDOM.render(<>
    <div>
      <Heading/>
      <Para/>
      <OrderData/>
    </div>
    </>,
  document.getElementById('root'));
